import React from "react";
import Meta from "./Meta";
import Header from "./Header";
import { Layout } from "antd";

const Page = (props) => {
  return (
    <>
      <Meta />
      <Layout>
        <Layout.Sider style={{ height: "100vh" }}>This is sider</Layout.Sider>
        <Layout>
          <Layout.Header>
            <Header />
          </Layout.Header>
          <Layout.Content>{props.children}</Layout.Content>
        </Layout>
      </Layout>
    </>
  );
};

export default Page;
